import React, { Component } from "react";
import "./Tutors.css";

class Tutors extends Component {
  render() {
      const { tutor } =this.props;
    return (
      <div className="tutors">
        <p>Insert images here</p>
        <h1>{tutor.name}</h1>
        <p>{tutor.email}</p>
      </div>
    );
  }
}

export default Tutors;
